import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Editor from '@monaco-editor/react';
import API from '../api';

export default function ChallengeDetail() {
    const { id } = useParams();
    const nav = useNavigate();
    const [chal, setChal] = useState(null);
    const [code, setCode] = useState('# write your solution here');
    const [runOut, setRunOut] = useState({ stdout: '', stderr: '' });
    const [msg, setMsg] = useState('');

    useEffect(() => {
        API.get(`/api/challenges/${id}`)
            .then(res => setChal(res.data))
            .catch(() => nav('/login'));
    }, [id, nav]);

    const handleRun = () => {
        setRunOut({ stdout: 'Running…', stderr: '' });
        API.post('/api/run-challenge', { challenge_id: +id, code })
            .then(res => setRunOut(res.data))
            .catch(e => setRunOut({ stdout: '', stderr: e.response?.data?.stderr || 'Error' }));
    };

    const handleSubmit = async () => {
        setMsg('Running & submitting…');
        try {
            const runRes = await API.post('/api/run-challenge', { challenge_id: +id, code });
            setRunOut(runRes.data);

            const output = runRes.data.stdout.trim();
            const subRes = await API.post('/api/submit-challenge', {
                challenge_id: +id, user_output: output
            });

            setChal(prev => ({ ...prev, completed: true }));
            setMsg(`${subRes.data.message} XP: ${subRes.data.xp}, Rank: ${subRes.data.rank}`);
        } catch (e) {
            setMsg(e.response?.data?.message || e.response?.data?.stderr || 'Error');
        }
    };

    if (!chal) return <p>Loading…</p>;

    return (
        <div className="challenge-detail-page">
            <div className="challenge-detail-card">
                <h1>{chal.title}</h1>
                <p><strong>Input:</strong> {chal.sample_input}</p>
                <p><strong>Status:</strong> {chal.completed ? '✅ Completed' : '❌ Incomplete'}</p>

                <Editor
                    height="60vh"
                    defaultLanguage="python"
                    value={code}
                    onChange={v => setCode(v)}
                    theme={document.body.classList.contains('light-mode') ? 'light' : 'vs-dark'}
                />

                {!chal.completed && (
                    <div style={{ margin: '1rem 0' }}>
                        <button className="enter-btn" onClick={handleRun}>Run</button>
                        <button className="enter-btn" onClick={handleSubmit} style={{ marginLeft: '1rem' }}>
                            Submit
                        </button>
                    </div>
                )}

                <div>
                    <h3>Output:</h3>
                    <pre style={{ background: '#111', color: '#fff', padding: '10px', borderRadius: '5px' }}>
                        {runOut.stdout}
                    </pre>
                    {runOut.stderr && (
                        <>
                            <h3 style={{ color: 'red' }}>Errors:</h3>
                            <pre style={{ background: '#300', color: '#f88', padding: '10px', borderRadius: '5px' }}>
                                {runOut.stderr}
                            </pre>
                        </>
                    )}
                </div>

                {msg && (
                    <p className={msg.startsWith('Correct') ? 'success-message' : 'error-message'}>
                        {msg}
                    </p>
                )}

                <div style={{ marginTop: '2rem' }}>
                    <button className="enter-btn" onClick={() => nav('/challenges')}>
                        Back to List
                    </button>
                    <button
                        className="enter-btn"
                        onClick={() => nav(`/challenges/${+id + 1}`)}
                        style={{ marginLeft: '1rem' }}
                    >
                        Next Challenge
                    </button>
                </div>
            </div>
        </div>
    );
}
